
SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";


CREATE DATABASE IF NOT EXISTS `info` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE `info`;



CREATE TABLE `classes` (
  `classId` tinyint(1) NOT NULL,
  `name` varchar(16) DEFAULT NULL,
  `chineseTeacher` mediumint(1) UNSIGNED DEFAULT NULL,
  `mathTeacher` mediumint(1) UNSIGNED DEFAULT NULL,
  `englishTeacher` mediumint(1) UNSIGNED DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




CREATE TABLE `student` (
  `studentId` int(1) UNSIGNED NOT NULL,
  `classId` tinyint(3) UNSIGNED NOT NULL,
  `name` varchar(16) DEFAULT NULL,
  `age` tinyint(1) UNSIGNED DEFAULT NULL,
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `teacher` (
  `teacherId` smallint(1) UNSIGNED NOT NULL,
  `subject` varchar(16) NOT NULL,
  `name` varchar(16) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




ALTER TABLE `classes`
  ADD PRIMARY KEY (`classId`);


ALTER TABLE `student`
  ADD PRIMARY KEY (`studentId`);


ALTER TABLE `teacher`
  ADD PRIMARY KEY (`teacherId`);


ALTER TABLE `classes`
  MODIFY `classId` tinyint(1) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=19;

CREATE DATABASE IF NOT EXISTS `score` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE `score`;


CREATE TABLE `2020` (
  `studentId` int(1) UNSIGNED NOT NULL,
  `subject` enum('chinese','math','english','') NOT NULL,
  `score` smallint(1) UNSIGNED DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



ALTER TABLE `2020`
  ADD PRIMARY KEY (`studentId`,`subject`);
COMMIT;
